import React from 'react';
import Footer from 'rc-footer';
import 'rc-footer/assets/index.css'; 
function PageFooter() {
    return (
        <div >


            <Footer className='foot'
    columns={
        [
            {
                icon: (
                    <img src="" />
                ),
                title: 'FRIENDYOL',
                url: '',
                description: '',
                openExternal: true,
            },
            {
                
                title: 'ABOUT US',
                url: '',
                description: '',
                openExternal: true,
            },
            {
                
                title: 'CAMPAINS',
                url: '',
                description: '',
                openExternal: true,
            }
        ]}


                bottom = "Made with ❤️ by Cin"
            />,
          
    </div >
  );
}
export default PageFooter;
